investigación con seres humanos debe obtener aprobación ética por parte de un
comité de revisión ética antes de iniciarse. Para constituir investigación con
seres humanos la propuesta debe ser una investigación y debe obtener
información de personas.</p>

<p>La investigación
se define como la actividad de ciencias sociales, biomédicas, del
comportamiento o epidemiológica que implica recabar o analizar datos
sistemáticamente con el objetivo de desarrollar conocimiento generalizable. Se
define a seres humanos como personas que que (i) se vuelven identificables
individualmente por la recolección, preparación o uso de material biológico o
records médicos o de otro tipo, o (ii) están expuestos a la manipulación,
intervención, observación u otra interacción con los investigadores
directamente o por medio de la alteración de su entorno.</p>

<p>La investigación
con seres humanos incluye estudios que usan tejidos, muestras, datos u otros
records de personas, así como estudios que involucran la conducción de
entrevistas, grupos focales o encuestas, o la observación del comportamiento
privado.</p>

<p>Las actividades
que no constituyen investigación con seres humanos están exentas de revisión
ética. Estas pueden ser actividades que no buscan la producción de conocimiento
generalizable o no involucran a seres humanos en las maneras descritas. Por
ejemplo, las siguientes actividades no constituyen investigación con seres
humanos y están por ello exentas de revisión ética:</p>

<ul><li>Estudios que
utilizan datos que están disponibles públicamente o son generados por la
observación de comportamiento público.</li></ul>

<ul><li>Estudios que
usan datos, muestras o tejidos ya existentes (previamente obtenido por otros)
que son recibidos por los investigadores de manera tal que la identidad de los
individuos no puede ser establecida.</li></ul>

<ul><li>Actividades de
salud pública llevadas a cabo por la autoridad reconocida de salud pública con
el objetivo de prevenir o controlar una enfermedad o daño, incluidas
actividades de vigilancia que buscan solo identificar o controlar un problema
de salud. Estas son actividades que buscan el beneficio de los participantes o
las comunidades de los participantes, y no buscan generar conocimiento que es
aplicable a otras poblaciones.</li></ul>

<ul><li>Actividades de
control de calidad o evaluaciones de programas que buscan mejorar el programa
en cuestión y sin intención de producir conocimiento generalizable.</li></ul>

<p>Hay proyectos que
pueden tener múltiples componentes, algunos de los cuales pueden constituir
investigación con seres humanos mientras que otros pueden no serlo. El
componente que constituye investigación con seres humanos debe pasar por
revisión ética. La determinación de si una propuesta no está exenta de revisión
ética la debe hacer una parte independiente, como un comité de revisión ética.</p>');
