seres humanos publicadas por OPS/OMS: <a href=\"http://www.paho.org/hq/index.php?option=com_docman&amp;task=doc_view&amp;Itemid=270&amp;gid=22738&amp;lang=es\" rel=\"nofollow\" target=\"_blank\">http://www.paho.org/hq/index.php?option=com_docman&amp;task=doc_view&amp;Itemid=270&amp;gid=22738&amp;lang=es</a> <br>');
¿Puede el estudio llevar a mejoras en la salud o el bienestar? ¿Cuál es el
valor potencial de la investigación para cada uno de los posibles
beneficiarios?</li></ul><ul><li>Validez
científica: ¿Es la investigación metodológicamente válida y científica (y
estadísticamente) sólida? ¿Va el estudio a generar datos válidos y confiables
que puedan ser generalizables? ¿Es viable? ¿Permite el diseño del estudio dar a
los participantes aquellos servicios de salud que les corresponden? Si no es el
caso, ¿hay razones metodológicas poderosas para no hacerlo y se protege a los
participantes de daños serios?</li></ul>

<ul><li>Selección justa
de participantes: ¿Cuáles son los criterios para incluir y excluir participantes?
¿Se basa la selección en criterios científicos? ¿Se selecciona a participantes
de manera que se minimicen los riesgos y se maximicen los beneficios
potenciales? Si los participantes son vulnerables, ¿hay salvaguardas para
protegerlos? ¿Se distribuyen los riesgos y potenciales beneficios del estudio
de manera equitativa?</li></ul>

<ul><li>Balance favorable
de riesgos y beneficios: ¿Pueden minimizarse los riesgos para los
participantes? ¿Pueden mejorarse los beneficios potenciales para los individuos
y la sociedad? ¿Son los beneficios potenciales para la sociedad y los
individuos superiores a los riesgos?</li></ul>

<ul><li>Consentimiento
informado: ¿Se da a los potenciales participantes la información acertada,
clara, relevante y completa? ¿Son los procedimientos de reclutamiento, el proceso
de consentimiento y los incentivos apropiados para la cultura y el contexto?
¿Hay un plan apropiado para obtener la autorización de quienes no pueden
consentir por si mismos? ¿Se aclara a los participantes que tienen derecho a no
participar? ¿Son libres de no participar?</li></ul>

<ul><li>Respeto por los
participantes: ¿Cómo se va a monitorear la salud y el bienestar de los
participantes para minimizar daños? ¿Cómo se va a proteger su privacidad?
¿Pueden retirarse del estudio sin represalias? ¿Cuáles son los planes de atención
luego de terminado el estudio? ¿Se les va a dar a los participantes cualquier
nueva información (incluidos los resultados del estudio)?</li></ul>

<p>(Adaptado de (1) Emanuel E, Wendler D, Grady C. An ethical
framework for biomedical research. In: Emanuel E et al. eds. The Oxford
textbook of clinical research ethics. New York, NY: Oxford University Press;
2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research
ethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C.
What makes clinical research in developing countries ethical? The benchmarks of
ethical research. JID 2004;189:930-937.)</p>

